import logo from './logo.svg';
import './App.css';
import {Heading, Icon} from 'react-bulma-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLira } from '@fortawesome/free-solid-svg-icons'
import 'bulma/css/bulma.min.css';

function Header(props) {
  const style = {
    paddingRight: "30px"
  };

  return <div> <Heading spaced="false"><Icon color="info" style={style}><FontAwesomeIcon icon={faLira} size="lg"/></Icon> Turbo Stacks </Heading></div>;
}

function App() {
  return (
    <div className="App">
    <Header/>
    </div>
  );
}

export default App;
